import classNames from 'classnames/bind';

import styles from './Navbar.module.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
    faBell,
    faEllipsis,
    faEllipsisVertical,
    faHandHoldingHeart,
    faHeart,
    faShieldHeart,
} from '@fortawesome/free-solid-svg-icons';
import { Button } from '~/components/Button';

const cx = classNames.bind(styles);

function Navbar() {
    let logined = true;

    return (
        <div className={cx('wrapper')}>
            {!logined && (
                <>
                    <Button children={'Đăng nhập'} primary />
                    <Button children={'Đăng ký'} />
                </>
            )}
            {logined && (
                <>
                    <Button children={'Đăng xuất'} />
                    <Button children={<FontAwesomeIcon icon={faBell} />} btn-icon />
                    <Button children={<FontAwesomeIcon icon={faHeart} />} btn-icon />
                    <img
                        className={cx('user')}
                        src="https://genk.mediacdn.vn/2018/4/8/ponyo-watching-recommendation-videosixteenbynine768-15231941245221140446230.jpg"
                        alt=""
                    />
                </>
            )}
            <FontAwesomeIcon icon={faEllipsisVertical} className={cx('nav-icon')} />
        </div>
    );
}

export default Navbar;
